		<style>

			.conversational-form cf-chat-response.robot text{
				background: #05668d;
				color: #f0f3bd;
			}

			.conversational-form cf-chat-response.user text{
				background: #f0f3bd;
				color: #05668d;
			}

			.conversational-form cf-input input{
				font-size: 150%;
				padding: 0px 10px;
				border: 4px solid #f0f3bd;
				border-radius: 14px;
				color: #05668d;
				box-shadow: none !important;
			}
			.conversational-form cf-button{
				border-radius: 0px;
				font-style: italic;

				<h2>Conversational Form examples</h2>
